import { createApp } from 'vue';
import App from './App.vue';
import HeadderTop from './components/HeadderTop.vue';
import MainContent from './components/mainConten.vue';
import CoTrang from './view/PhimCoTrang.vue';
import { createRouter, createWebHistory } from "vue-router";
const router = createRouter({
  history: createWebHistory(),
  routes: [{
    path: '/home/CoTrang',
    component: CoTrang
  }, {
    path: '/ho',
    component: MainContent
  }]
});
const app = createApp(App);
app.component('HeadderTop', HeadderTop);
app.component('MainContent', MainContent);
app.mount('#app');
app.use(router);
